	var slots = Object.keys(raw);

	var data = {};

	init();

	function init() {
		//default of DH, seasonal, softcore
		if (typeof cl === 'undefined') { cl = 'Demon Hunter'}
		if (typeof seasonal === 'undefined') { seasonal = true }
		if (typeof hardcore === 'undefined') { hardcore = false }

		sortData();
	}

	function sortData() {
		var slotCount = slots.length;
		for (var i = 0; i < slotCount; i++) {

			//initialize this slot object
			data[slots[i]] = {};
			//set the total slot weight to zero
			data[slots[i]].total = 0;

			//array of all items for a given slot
			var items = raw[slots[i]];
			var itemLength = items.length;

			//sort out all of the smart and not so smart loot
			//to determine if we roll through all items or just smart ones
			var smartLoot = [];
			var notSmartLoot = [];

			for (var j =0; j < itemLength; j++) {
				//keep seasonal/hc items out of non-seasonal/softcore
				if((!seasonal && items[j].season) || (!hardcore && items[j].hc)) {
					continue;
				}
				else {
					//push into correct loot pool
					(items[j].smartLoot.indexOf(cl) !== -1) ? smartLoot.push(items[j]) : notSmartLoot.push(items[j]);
				}
			}

			//set up loot pool
			(smartLoot.length === 0) ? data[slots[i]].items = notSmartLoot : data[slots[i]].items = smartLoot;

			//overwrite these and loop through again to get total weight
			var items = data[slots[i]].items;
			var itemLength = items.length;
			for(var k = 0; k < itemLength; k ++) {
				data[slots[i]].total += items[k].weight;
			}

		}
	}

	function rollItem(slot) {
		var newItem = {};

		newItem.slot = slot;
		newItem.rarity = rollRarity();

		//if the item is legendary we need to roll for one
		if (newItem.rarity === 'legendary' || newItem.rarity === 'ancient') {
			newItem.name = rollLegendary(slot);
		}

		return newItem;
	}

	function rollRarity() {
		var val = Math.random()*100;
		if (val >= 99) {return 'ancient';}
		if (val >= 90) {return 'legendary';}
		if (val < 60) {return 'rare';}
		else {return 'magic';}
	}

	function rollLegendary(slot) {
		var val = Math.random()*data[slot].total;

		var itemsLength = data[slot].items.length;
		for (var i =0; i < itemsLength; i++) {
			val -= data[slot].items[i].weight;
			if (val < 0 ) {
				return data[slot].items[i].name;
			}
		}

	}

